export const ENABLE_FEATURE_ACTION = '[features]ENABLE_FEATURE_ACTION';
export const enableFeatureAction = featureName => ({
    type: ENABLE_FEATURE_ACTION,
    payload: featureName,
});

export const DISABLE_FEATURE_ACTION = '[features]DISABLE_FEATURE_ACTION';
export const disableFeatureAction = featureName => ({
    type: DISABLE_FEATURE_ACTION,
    payload: featureName,
});
